import {Component} from '@angular/core';
import {Camera, CameraOptions} from '@ionic-native/camera';
import {Marker} from "../storage/model/marker";
import {StorageService} from "../storage/storageService";
import {AlertController, NavController} from 'ionic-angular';
import {AboutComponent} from "../about/about.component";
import {CatClient, SearchResult} from "./CatClient";

declare const require: any;
const mx = require("mxgraph")({
    mxImageBasePath: "assets/images",
    mxBasePath: "assets"
});

@Component({
    templateUrl: "./home.html"
})
export class HomeComponent {

    public image64: string;

    private static options: CameraOptions;

    private markers: Marker[] = [];

    private graph: any;

    private label: any;

    private catClient: CatClient;

    constructor(private camera: Camera,
                private alertCtrl: AlertController,
                private navCtrl: NavController) {
        if (!this.image64) {
            HomeComponent.options = {
                quality: 100,
                destinationType: camera.DestinationType.DATA_URL,
                encodingType: camera.EncodingType.JPEG,
                mediaType: camera.MediaType.PICTURE,
                correctOrientation: true
            };
        }
        this.catClient = new CatClient();
    }

    ionViewDidLoad(): void {
        const container = document.getElementById('graphContainer');
        mx.mxEvent.disableContextMenu(container);
        this.graph = new mx.mxGraph(container);
        this.graph.cellsMovable = false;
        this.graph.cellsSelectable = false;
        // this.graph.zoom(1.6);
        let style = this.graph.getStylesheet().getDefaultVertexStyle();
        style[mx.mxConstants.STYLE_VERTICAL_ALIGN] = "middle";
        style[mx.mxConstants.STYLE_STROKECOLOR] = "red";
        style[mx.mxConstants.STYLE_FILLCOLOR] = "rgba(255, 0, 0, 0.2)";
        style[mx.mxConstants.STYLE_FONTCOLOR] = "#FFFFFF";
        style[mx.mxConstants.STYLE_FONTSTYLE] = 1;

        if (!this.image64) {
            this.restoreImage();
        }
    }

    public addMarker(event): void {
        const header = document.getElementsByClassName("header");
        const clickX = event.center.x - Marker.SIZE / 2;
        const clickY = event.center.y - Marker.SIZE / 2 - header[0].clientHeight;
        for (let i = 0; i < this.markers.length; i++) {
            if (Math.abs(clickX - this.markers[i].x) < Marker.SIZE / 2 && Math.abs(clickY - this.markers[i].y) < Marker.SIZE / 2) {
                event.preventDefault();
                this.editMarker(i);
                return;
            }
        }
        const parent = this.graph.getDefaultParent();
        const marker = new Marker(this.markers.length + 1, clickX, clickY);
        this.catClient.addMarker(marker)
            .then((markerID) => {
                marker.id = markerID;
                this.markers.push(marker);
                this.graph.getModel().beginUpdate();
                this.graph.insertVertex(parent, null, this.markers.length, clickX, clickY, Marker.SIZE, Marker.SIZE, "shape=ellipse");
                this.graph.getModel().endUpdate();
            });
    }

    public showLabel(event): void {
        const clickX = event.offsetX;
        const clickY = event.offsetY;
        const parent = this.graph.getDefaultParent();

        if (this.label) {
            console.warn(this.label.geometry.x, this.label.geometry.y);
            this.graph.getModel().beginUpdate();
            this.graph.removeCells([this.label]);
            this.graph.getModel().endUpdate();
        }

        for (let i = 0; i < this.markers.length; i++) {
            if (this.isSelectedMarker(clickX - Marker.SIZE / 2, clickY - Marker.SIZE / 2, this.markers[i])) {
                if (this.markers[i].information) {
                    this.graph.getModel().beginUpdate();
                    let label = this.graph.insertVertex(parent, null, this.markers[i].information, this.markers[i].x - Marker.SIZE / 2, (this.markers[i].y - Marker.SIZE / 2) - 8, 80, 20, "autosize=1;fillColor=rgb(255, 0, 0)");
                    this.label = label;
                    this.graph.updateCellSize(label);
                    this.graph.getModel().endUpdate();
                }
            }
        }
    }

    public isSelectedMarker(clickX: number, clickY: number, marker: Marker): boolean {
        return Math.abs(clickX - marker.x) < Marker.SIZE / 2 && Math.abs(clickY - marker.y) < Marker.SIZE / 2
    }

    private editMarker(index: number) {
        const alert = this.alertCtrl.create({
            title: 'Marker ' + (index + 1),
            inputs: [
                {
                    name: 'text',
                    placeholder: "information",
                    value: this.markers[index].information
                }
            ],
            buttons: [
                {
                    text: 'Save',
                    handler: data => {
                        this.markers[index].information = data.text;
                        this.catClient.updateMarkers([this.markers[index]]);
                    }
                },
                {
                    text: 'Remove',
                    handler: () => {
                        this.catClient.removeMarker(this.markers[index].id);
                        this.markers.splice(index, 1);
                        for (let i = 0; i < this.markers.length; i++) {
                            this.markers[i].number = i + 1;
                        }
                        this.catClient.updateMarkers(this.markers);
                        for(let marker of this.markers) {
                            console.warn(marker);
                        }
                        this.graph.destroy();
                        this.ionViewDidLoad();
                        this.restoreMarkers();
                    }
                },
                {
                    text: 'Cancel',
                    role: 'cancel',
                    handler: () => {
                    }
                }
            ]
        });
        alert.present();
    }

    public get graphStyle() {
        return "url(" + this.image64 + ")";
    }

    public getImage(): void {
        this.camera.getPicture(HomeComponent.options)
            .then((imageURI: string) => {
                this.catClient.addImage(this.image64);
                this.markers = [];
                this.image64 = null;
                this.graph.destroy();
                this.ionViewDidLoad();
            })
            .catch((exception) => {
                if (exception === "cordova_not_available") {
                    this.image64 = HomeComponent.getCat();
                    this.catClient.addImage(this.image64);
                } else {
                    console.error("Something went wrong...", exception);
                }
            });
    }

    private restoreImage(): void {
        const id = StorageService.getLastImage();
        if (!id) {
            this.image64 = HomeComponent.getCat();
            this.markers = [];
        } else {
            this.catClient.getImage(id)
                .then((result: SearchResult) => {
                    this.image64 = result.image;
                    this.markers = result.markers;
                    this.graph.destroy();
                    this.ionViewDidLoad();
                    this.restoreMarkers();
                });
        }
    }

    private restoreMarkers() {
        const parent = this.graph.getDefaultParent();
        this.graph.getModel().beginUpdate();
        for (let i = 0; i < this.markers.length; i++) {
            this.graph.insertVertex(parent, null, i + 1, this.markers[i].x, this.markers[i].y, Marker.SIZE, Marker.SIZE, "shape=ellipse");
        }
        this.graph.getModel().endUpdate();
    }

    public goAbout(): void {
        this.navCtrl.push(AboutComponent);
    }


    private static getCat(): any {
        return "data:image/jpeg;base64,"
    }
}
